import React from "react";
import DoctorMenu from "../components/layout/DoctorMenu";
import "../styles/doctorplans.css";
const DoctorPlansPackages = () => {
  const plansData = [
    {
      icon: "novide",
      title: "Novice",
      price: "$10/mth",
      billing: "Billed annually.",
      features: [
        "Access to all basic features",
        "Basic reporting and analytics",
        "Up to 10 individual users",
        "20GB individual data each user",
        "Basic chat and email support",
      ],
      buttonText: "Select Plan",
    },
    {
      icon: "novide",
      title: "Novice",
      price: "$10/mth",
      billing: "Billed annually.",
      features: [
        "Access to all basic features",
        "Basic reporting and analytics",
        "Up to 10 individual users",
        "20GB individual data each user",
        "Basic chat and email support",
      ],
      buttonText: "Select Plan",
    },
    {
      icon: "novide",
      title: "Novice",
      price: "$10/mth",
      billing: "Billed annually.",
      features: [
        "Access to all basic features",
        "Basic reporting and analytics",
        "Up to 10 individual users",
        "20GB individual data each user",
        "Basic chat and email support",
      ],
      buttonText: "Select Plan",
    },
    {
      icon: "novide",
      title: "charu",
      price: "$10/mth",
      billing: "Billed annually.",
      features: [
        "Access to all basic features",
        "Basic reporting and analytics",
        "Up to 10 individual users",
        "20GB individual data each user",
        "Basic chat and email support",
      ],
      buttonText: "Select Plan",
    },
  ];
  return (
    <DoctorMenu>
      <section className="text-center w-100 vh-100 ">
        <h2 className=" pt-5">
          <span> Powerful features for</span>
          <br /> <span className="color-purple">powerful Athletes</span>
        </h2>
        <p className="mt-3">Choose a plan thatâ€™s right for you</p>

        <div
          className="d-flex justify-content-between plan-container "
          style={{ width: "80%", margin: "40px 10px", gap: "20px" }}
        >
          {plansData.map((plan, index) => (
            <PlanSingle key={index} planData={plan} />
          ))}
        </div>
      </section>
    </DoctorMenu>
  );
};

export default DoctorPlansPackages;
const PlanSingle = ({ planData }) => {
  const { icon, title, price, billing, features, buttonText } = planData;

  return (
    <div className="plan-single-cont">
      <div className="m-auto">
        <div className={`icon-cont-${icon} m-auto`}>
          <img src={`/images/icons/${icon}.svg`} alt={icon} />
        </div>
        <h2 className="color-purple">{title}</h2>
        <h1>{price}</h1>
        <p>{billing}</p>
      </div>

      <table className="table table-borderless">
        <tbody>
          {features.map((feature, index) => (
            <tr key={index}>
              <td>
                <img src="/images/icons/tick.svg" alt="tick" />
              </td>
              <td>{feature}</td>
            </tr>
          ))}
        </tbody>
      </table>

      <div className="m-auto">
        <button
          type="submit"
          className="purple-button"
          style={{ width: "270px" }}
        >
          {buttonText}
        </button>
      </div>
    </div>
  );
};
